    return ( 
        <main className="mt-10">
            <h1>Serach for a Pokemon</h1>
            <p>input pokemon's name or number</p>
            <div>
                <input type="Name or Number" />
                <button>Buscar</button>
            </div>
        </main>
    );
}

export default Busqueda;
